import{_ as e,c as o,o as r,ah as p}from"./chunks/framework.PvdZnrZd.js";const m=JSON.parse('{"title":"Import Products","description":"Import Products","frontmatter":{"title":"Import Products","description":"Import Products","date":"2025-07-02T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/products/import-products.md","filePath":"zenith/products/import-products.md"}'),a={name:"zenith/products/import-products.md"};function s(i,t,n,d,l,c){return r(),o("div",null,[...t[0]||(t[0]=[p('<p>Admin can import products added on his Shopify Store to <a href="https://marketplace-doc.webkul.com/zenith/introduction/" target="_blank" rel="noreferrer">Multivendor Marketplace for Shopify</a>, after this, the admin needs to assign those products to the sellers.</p><p>Now, to make the products appear in the Product menu, you need to assign the imported products to the sellers. Then only, the orders will be created in the Multi-vendor App.</p><h2 id="let-s-see-how-the-admin-can-do-this" tabindex="-1">Let&#39;s see how the Admin can do this: <a class="header-anchor" href="#let-s-see-how-the-admin-can-do-this" aria-label="Permalink to &quot;Let&#39;s see how the Admin can do this:&quot;">​</a></h2><p>Go to: Multivendor Marketplace Admin Panel &gt; Products &gt; Import Products &gt; Click on the &#39;Import Products&#39; button:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/imp1.webp" alt="Import Product From Shopify Admin"></p><p>On the redirected page, the admin will get two different methods to import the products in bulk:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/imp2.webp" alt="Import Product From Shopify Admin (1)"></p><p><strong>Method 1:</strong></p><p>Import products by date range; select the FROM &amp; TO dates between which you want the products from your Shopify store to get imported in your Multivendor Marketplace.</p><p>Note: You need to choose the date range accordingly while importing products because only those products will be imported which are available under the date range selected by you.</p><p><strong>Method 2:</strong></p><p>Import products via CSV file; the admin can also download a dummy CSV file for reference.</p><h2 id="assign-imported-products-to-sellers" tabindex="-1">Assign Imported Products to Sellers <a class="header-anchor" href="#assign-imported-products-to-sellers" aria-label="Permalink to &quot;Assign Imported Products to Sellers&quot;">​</a></h2><p>The imported products will be listed on the following page-</p><p>Multivendor Marketplace Admin Panel &gt; Products &gt; Import Products:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/imp3.webp" alt="Import Product From Shopify Admin (2)"></p><p>Now, the admin needs to click on the three dots (<strong>⋅⋅⋅</strong>) under the ACTION menu &amp; then click on the &#39;Assign product to seller&#39; button. This action will give you a pop-up:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/09/imp4.webp" alt="Import Product From Shopify Admin (3)"></p><p>On this pop-up, the admin can change the product type (normal/global/digital) &amp; then he needs to enter the seller email ID.</p><p><strong>Mark</strong>:<br> If the product has variants then admin can&#39;t change the product type to Global/Digital while assigning them to the seller.</p><h3 id="demo-details" tabindex="-1">Demo Details <a class="header-anchor" href="#demo-details" aria-label="Permalink to &quot;Demo Details&quot;">​</a></h3><p>Check out: <a href="https://multivendor-marketplace-5.myshopify.com/pages/seller-profile" target="_blank" rel="noreferrer">https://multivendor-marketplace-5.myshopify.com/pages/demo</a></p>',22)])])}const u=e(a,[["render",s]]);export{m as __pageData,u as default};
